import React from "react"
import styled from "styled-components"
import FILE1 from "../components/files/file1"

const Ul = styled.ul`
  display: flex;
`
const Li = styled.li`
  width: 40px;
  height: 40px;
  text-align: center;
  line-height: 40px;
  border-radius: 50%;
  background-color: red;
`
const Home = () => {
  return (
    <div>
      <div>
        <Ul>
          <Li>1</Li>
          <Li>2</Li>
          <Li>3</Li>
        </Ul>
      </div>
      <table border={1}>
        <tr>
          <th>ID voice</th>
          <td>duration</td>
        </tr>
        {FILE1.map((item) => (
          <tr key={item.voice_id}>
            <th>{item.voice_id}</th>
            <td>{item.audioCredit.callDuration}</td>
          </tr>
        ))}
      </table>
    </div>
  )
}

export default Home
